import React from "react"
import Index from "../views/index/index"
import Find from "../views/find/index"
import Video from "../views/video/index"
import Village from "../views/village/index"

let nav = ["mine","find","video","village"]
let router=[
    {
        path:"/mine",
        exact:true,
        render(props){
            return (<Index/>)
        }
    },{
        path:"/find",
        exact:true,
        render(props){
            return (<Find/>)
        }
    },{
        path:"/video",
        exact:true,
        render(props){
            return (<Video/>)
        }
    },{
        path:"/village",
        exact:true,
        render(props){
            return (<Village/>)
        }
    }
]
let navData = [
    {
        path:"/mine",
        title:"我的",
        exact:true,
        active:"active"
    },{
        path:"/find",
        title:"发现",
        exact:true,
        active:"active"
    },{
        path:"/village",
        title:"云村",
        exact:true,
        active:"active"
    },{
        path:"/video",
        title:"视频",
        exact:true,
        active:"active"
    }
]

export {navData,router,nav}
